import React, { Component } from 'react';
import TextComponent from '../TextComponent';

const Sky = function(props){
    return(
        <React.Fragment>
            <rect x="0" y="0" width={window.innerWidth} height={window.innerHeight}
                fill="#f6df93"
            >
            </rect>
            <circle cx={window.innerWidth} cy="0" r="1000" fill={props.fill}>
            </circle>
        </React.Fragment>
    )
}
const Blade = function(props){
    return(
        <g transform={props.transform}>
            <rect x={0} y={0} width={props.width} height={props.height} stroke="#251516" strokeWidth="10">
            </rect>
            {
                (() => {
                    let bars = [], noOfBars = 4;
                    for(let i = 1; i < noOfBars; i++)
                        bars.push(
                            <line key={i} x1={i * props.width / noOfBars} y1="0" x2={i * props.width / noOfBars} y2={props.height} stroke="#251516" strokeWidth="5"/>
                        )
                    return bars;
                })()
            }
        </g>
    )
}

